import logo from './logo.svg';
import './App.css';
import { Component } from 'react';

class App extends Component {
  constructor() {
    super()
    this.state = {
      name:'Neha',
      company:'System73'
    }
  }
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p>
            Hi {this.state.name}, I worked at {this.state.company}
          </p>
          <button onClick={() => {
            this.setState({name:'Akshara'})
            console.log(this.state)
          }}>
            Change Me
          </button>
        </header>
      </div>
    );
  }
}

export default App;
